import React , { useState, useEffect } from 'react';
import './OrderMng.css';
import OrderQ from './OrderQ.jsx';
import OrderMngNav from './OrderMngNav.jsx';
import CompletedOrders from './CompletedOrders.jsx'
import OrderHistory from './OrderHistory.jsx'
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Table} from 'react-bootstrap';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function OrderMng() {
		return(
			<Router>

			<div className="tc">
					
					<Switch>
						<Route path="/order">
							<OrderMngNav colr="0"/>
							<OrderQ/>
						</Route>
						<Route path="/completedOrders">
							<OrderMngNav/>
							<CompletedOrders/>
						</Route>
						<Route path="/history">
							<OrderMngNav/>
							<OrderHistory/>
						</Route>
					</Switch>
			
			</div>
			</Router>
		
		);
		
}


export default OrderMng;
